import React from 'react';
import styled from 'styled-components';

const Projects = () => {
  return (
    <Wrapper>
      <h2>Here are some of my projects</h2>
      <div>
        Final Project
      </div>
      
      <div>
        Group Project
      </div>

      <div>
        Dogspace
      </div>

      <div>
        Twitter Clone
      </div>

      <div>
        Bob's Burgers game
      </div>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  height: 100vh;
  width: 100vw;
`;

export default Projects
